import ChartBar from "./ChartBar"
import "./Chart.css"

function Chart(props){
    return(
        <div className="chart">
            {props.dataPoints.map((dataPoints => 
                <ChartBar 
                    key={dataPoints.id} 
                    value={dataPoints.value} 
                    maxValue={null} 
                    label={dataPoints.label}
                />    
            ))}
        </div>
    )
}

export default Chart
